function calculateDuration(text) {
  const parts = text.split(':');
  parts.reverse();
  var seconds = 0;
  for (var i = 0; i < parts.length; i++) {
    seconds += parseInt(parts[i]) * Math.pow(60, i);
  }
  return seconds;
}

msg.stats = {
  comments: parseInt(msg.comments.replaceAll(',', '')),
  dislikes: parseInt(msg.dislikes.split(' ')[0].replaceAll(',', '')),
  duration: calculateDuration(msg.duration),
  likes: parseInt(msg.likes.split(' ')[0].replaceAll(',', '')),
  views: parseInt(msg.views.split(' ')[0].replaceAll(',', '')),
};
return msg;

